import { Accordion, AccordionSummary } from "@material-ui/core";
function Flight() {
  return (
    <div className="wrapper">
      <h3>Kết quả tìm kiếm</h3>
      <Accordion>
        <AccordionSummary
          // expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >

        </AccordionSummary>
      </Accordion>
    </div>
  );
}

export default Flight;
